import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import {ReactComponent as ICON_QUOTE} from './assets/svg/quote.svg'
import {ReactComponent as ICON_TUMBLR} from './assets/svg/tumblr.svg'
import {ReactComponent as ICON_TWITTER} from './assets/svg/twitter-x.svg'
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div id='quote-box'>
      <ICON_QUOTE id='icon_quote'/>
      <div id='text'>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</div>
      <div id='author'>- Author Name -</div>
      <button id='new-quote'>New Quote</button>
      <div className='row' style={{
        marginTop: '30px',
        gap: '20px'
      }}>
        <a id='tweet-quote' href='#'>
          <ICON_TWITTER/>
        </a>
        <a id='tumblr-quote' href='#'>
          <ICON_TUMBLR/>
        </a>
      </div>
    </div>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
